import React from 'react';
import { Breadcrumbs, Link, Button } from '@material-ui/core';
// import PropTypes from 'prop-types'
// import { Link } from "react-router-dom";

export const Header = (props) => {
    let mystyle = {
        display: 'flex',
        justifyContent: 'center',
    }
    function handleClick(event) {
        event.preventDefault();
        console.info('You clicked a breadcrumb.');
    }
    return (
        <>
            {/* <img src="../public/etarkimg.png" style={mystyle} alt="logo" /> */}
            <nav>
                
                    <Link color="inherit" href="/" onClick={handleClick} aria-current="page">
                        HOW TO USE
                    </Link>
                    <Link color="inherit" href="/getting-started/installation/" onClick={handleClick} aria-current="page">
                        ABOUT US
                    </Link>
                    <Link
                        color="textPrimary"
                        href="/components/breadcrumbs/"
                        
                        aria-current="page"
                    >
                        CONTACT US
                    </Link>
                
            </nav>
                <Button variant="contained" color="primary">
                    Primary
                </Button>
        </>
    )
}
